export const colors = {
  darkGreen: "rgba(84, 65, 0, 1)",
  blue: `rgba(0,0,255, 1)`,
  red: `rgba(255,0,0,1)`,
  pink: `rgba(251, 231, 239, 1)`,
  white: `rgba(255, 255, 255,1)`,
  orange: `rgba(249, 180, 45,1)`,
  yellow: `rgba(255, 252, 127,1)`,
  green: `rgba(178, 222, 39,1);`,
  dirtWhite: `rgba(238, 255, 255, 1)`,
};

export const namedColors = {
  buttonBg: colors.darkGreen,
  buttonSign: colors.dirtWhite,
};
